		}
		out.writeBoolean(fair);	
	}

	@Override
	public SynchronousQueue readObject(OInput in, Class<SynchronousQueue> clazz) throws IOException {
		boolean fair = in.readBoolean();
		SynchronousQueue queue = new SynchronousQueue(fair);
		return queue;
	}
}

